import React from 'react';
import './App.css';

const HomePage: React.FC = () => {
  return (
    <>
      <header>
        <h1>Questio</h1>
      </header>
      <div className="container">
        <h2>Questio와 면접을 준비해봐요</h2>
        <p>포트폴리오를 분석해서 면접을 도와드릴게요 당신의 잠재력을 일깨워드릴게요</p>
        <button onClick={() => window.location.href = '/upload'}>시작해보기</button>
      </div>
    </>
  );
};

export default HomePage;
